import React from 'react';
// import web from '../src/image/Team.svg';
// import web2 from '../src/image/Team2.jpg';
import Common from './Common'





const Team = () => {
    return (
        <>
            <div className='Team_section section_padding'>
                <div className='container'>
                    <h2 className='text-center text-primary mb-5'>Team Formation Details</h2>
                </div>
            </div>
        </>
    )
}

export default Team;
